// frontend/src/components/Results.js
import React from 'react';
import './Results.css';

const Results = ({ results }) => {
    if (!results) return null;

    const { instrument, multiclass_probabilities, ensemble_probabilities, spectrogram } = results;

    return (
        <div className="results">
            <h3>Resultados del An√°lisis</h3>
            <p><strong>Instrumento Detectado (Multiclase):</strong> {instrument}</p>

            <h4>Probabilidades del Modelo Multiclase:</h4>
            <ul>
                {multiclass_probabilities.map((prob, index) => (
                    <li key={index}>
                        Instrumento {index + 1}: {(prob * 100).toFixed(2)}%
                    </li>
                ))}
            </ul>

            <h4>Probabilidades del Modelo Ensamblado:</h4>
            <ul>
                {Object.entries(ensemble_probabilities).map(([instrument, prob]) => (
                    <li key={instrument}>
                        {instrument}: {(prob * 100).toFixed(2)}%
                    </li>
                ))}
            </ul>

            <h4>Espectrograma Generado:</h4>
            <img src={`data:image/png;base64,${spectrogram}`} alt="Espectrograma" />
        </div>
    );
};

export default Results;
